<!DOCTYPE html>
<html lang="pt-BR">
<head>
<meta charset="UTF-8">
<title>Sistema Secreto</title>
<style>
body {
    background: #0d0d0d;
    color: #00ffea;
    font-family: Consolas, monospace;
    display: flex;
    justify-content: center;
    align-items: center;
    height: 100vh;
    margin: 0;
}
.box {
    border: 2px solid #00ffea;
    padding: 30px;
    width: 350px;
    border-radius: 10px;
    box-shadow: 0 0 20px #00ffea;
    text-align: center;
}
input {
    width: 90%;
    padding: 10px;
    margin: 10px 0;
    background: #111;
    color: #00ffea;
    border: 1px solid #00ffea;
    border-radius: 5px;
    font-size: 16px;
}
button {
    width: 95%;
    padding: 10px;
    margin-top: 10px;
    background: #00ffea;
    color: #000;
    border: none;
    border-radius: 5px;
    font-weight: bold;
    cursor: pointer;
}
button:hover {
    background: #00c7be;
}
#conteudo {
    display: none;
    margin-top: 20px;
}
#conteudo img {
    max-width: 100%;
    border-radius: 10px;
    margin-bottom: 15px;
}
.frase {
    font-size: 16px;
    color: #ffffff;
    line-height: 1.4em;
    font-family: Arial, sans-serif;
}
</style>
</head>
<body>

<div class="box">
    <h2>ACESSO RESTRITO</h2>

    <div id="login-area">
        <input id="login" placeholder="Login">
        <input id="senha" placeholder="Senha" type="password">
        <button onclick="entrar()">Entrar</button>
        <div id="msg"></div>
    </div>

    <div id="conteudo"></div>
</div>
